import React from "react";

const Footer = () => {
  return (
    <div className="fotter">
      <div className="wrapper">
        <div className="top">
          <div className="item">
            <h></h>
          </div>
          <div className="item"></div>
          <div className="item"></div>
          <div className="item"></div>
        </div>
        <div className="bottom"></div>
      </div>
    </div>
  );
};

export default Footer;
